import React from 'react';
import SideBar from "../sidebar";

const About = () => {
    return (
        <div id="About">
            <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />
            <div>
                <h1>About US</h1>
                <p>About US page body content</p>
            </div>
        </div>
);
}

export default About;
